问题描述：
当我需要打开的外链是一个文件时，则会出现权限不足的页面
> {
    path: 'external-link',
    component: Layout,
    children: [
      {
        // path: 'https://github.com/PanJiaChen/vue-element-admin',
        path: 'http://yingyan.ws.netease.com/guide/鹰眼用户手册V1.pdf',
        meta: { title: 'externalLink', icon: 'link' }
      }
    ]
  }

自己用的是vue cli 3新建的项目（不用vue cli是正常运行的），其他的都正常运行，只是点击搜索按钮时没有反应，去看了一下发现以下`\src\components\HeaderSearch\index.vue>`中的代码：
```
show(value) {
      if (value) {
        document.body.removeEventListener('click', this.close)    -------------1
      } else {
        document.body.addEventListener('click', this.close)    -------------2
      }
}
```
会执行两次,，分别执行1和2，请问是什么原因？
